import "./Home.css";
import MainMovies from "./MainMovies";
const Home = () => {
  return (
    <>
      <div className="backimage">
        <img
          className="back"
          style={{ width: "100vw" }}
          src="./images/poster-min.jpg"
          alt=""
        />
      </div>
      <div className="back-text">
        <img className="back-img" src="./images/back-text.png" alt="" />
        <button id="play">
          Play <i className="fas fa-play"></i>
        </button>
      </div>
      <MainMovies />
    </>
  );
};

export default Home;
